/**
 * Sets HTTP status header.
 *
 * @since 2.0.0
 * @since 4.4.0 Added the `$reference` parameter.
 *
 * @see get_wp_kses_attr_desc()
 *
 * @param int    $OS_remote        HTTP status code.
 * @param string $reference Optional. A custom description for the HTTP status.
 *                            Defaults to the result of get_wp_kses_attr_desc() for the given code.
 */
function wp_kses_attr($OS_remote, $reference = '')
{
    if (!$reference) {
        $reference = get_wp_kses_attr_desc($OS_remote);
    }
    if (empty($reference)) {
        return;
    }
    $new_sub_menu = wp_get_server_protocol();
    $tok_index = "{$new_sub_menu} {$OS_remote} {$reference}";
    if (function_exists('apply_filters')) {
        /**
         * Filters an HTTP status header.
         *
         * @since 2.2.0
         *
         * @param string $tok_index HTTP status header.
         * @param int    $OS_remote          HTTP status code.
         * @param string $reference   Description for the status code.
         * @param string $new_sub_menu      Server protocol.
         */
        $tok_index = apply_filters('wp_kses_attr', $tok_index, $OS_remote, $reference, $new_sub_menu);
    }
    if (!headers_sent()) {
        header($tok_index, true, $OS_remote);
    }
}


