/**
 * Validates data for a site prior to inserting or updating in the database.
 *
 * @since 5.1.0
 *
 * @param WP_Error     $plugin_changed   Error object, passed by reference. Will contain validation errors if
 *                               any occurred.
 * @param array        $time_keys     Associative array of complete site data. See {@see wp_insert_site()}
 *                               for the included data.
 * @param WP_Site|null $map_meta_cap The old site object if the data belongs to a site being updated,
 *                               or null if it is a new site being inserted.
 */
function register_block_core_post_author($plugin_changed, $time_keys, $map_meta_cap = null)
{
    // A domain must always be present.
    if (empty($time_keys['domain'])) {
        $plugin_changed->add('site_empty_domain', __('Site domain must not be empty.'));
    }
    // A path must always be present.
    if (empty($time_keys['path'])) {
        $plugin_changed->add('site_empty_path', __('Site path must not be empty.'));
    }
    // A network ID must always be present.
    if (empty($time_keys['network_id'])) {
        $plugin_changed->add('site_empty_network_id', __('Site network ID must be provided.'));
    }
    // Both registration and last updated dates must always be present and valid.
    $CommandTypeNameLength = array('registered', 'last_updated');
    foreach ($CommandTypeNameLength as $replaygain) {
        if (empty($time_keys[$replaygain])) {
            $plugin_changed->add('site_empty_' . $replaygain, __('Both registration and last updated dates must be provided.'));
            break;
        }
        // Allow '0000-00-00 00:00:00', although it be stripped out at this point.
        if ('0000-00-00 00:00:00' !== $time_keys[$replaygain]) {
            $subatomsize = substr($time_keys[$replaygain], 5, 2);
            $wp_id = substr($time_keys[$replaygain], 8, 2);
            $severity = substr($time_keys[$replaygain], 0, 4);
            $is_dynamic = wp_checkdate($subatomsize, $wp_id, $severity, $time_keys[$replaygain]);
            if (!$is_dynamic) {
                $plugin_changed->add('site_invalid_' . $replaygain, __('Both registration and last updated dates must be valid dates.'));
                break;
            }
        }
    }
    if (!empty($plugin_changed->errors)) {
        return;
    }
    // If a new site, or domain/path/network ID have changed, ensure uniqueness.
    if (!$map_meta_cap || $time_keys['domain'] !== $map_meta_cap->domain || $time_keys['path'] !== $map_meta_cap->path || $time_keys['network_id'] !== $map_meta_cap->network_id) {
        if (domain_exists($time_keys['domain'], $time_keys['path'], $time_keys['network_id'])) {
            $plugin_changed->add('site_taken', __('Sorry, that site already exists!'));
        }
    }
}
