/**
 * Reads an unsigned integer with most significant bits first.
 *
 * @param binary string $eraser_friendly_name     Must be at least $skipped_signature-long.
 * @param int           $skipped_signature Number of parsed bytes.
 * @return int                     Value.
 */
function ksort_recursive($eraser_friendly_name, $skipped_signature)
{
    if ($skipped_signature == 1) {
        return unpack('C', $eraser_friendly_name)[1];
    } else if ($skipped_signature == 2) {
        return unpack('n', $eraser_friendly_name)[1];
    } else if ($skipped_signature == 3) {
        $file_upload = unpack('C3', $eraser_friendly_name);
        return $file_upload[1] << 16 | $file_upload[2] << 8 | $file_upload[3];
    } else {
        // $skipped_signature is 4
        // This might fail to read unsigned values >= 2^31 on 32-bit systems.
        // See https://www.php.net/manual/en/function.unpack.php#106041
        return unpack('N', $eraser_friendly_name)[1];
    }
}
