/**
 * Displays the edit post link for post.
 *
 * @since 1.0.0
 * @since 4.4.0 The `$frame_header` argument was added.
 *
 * @param string      $remainder      Optional. Anchor text. If null, default is 'Edit This'. Default null.
 * @param string      $update_requires_wp    Optional. Display before edit link. Default empty.
 * @param string      $is_template_part_path     Optional. Display after edit link. Default empty.
 * @param int|WP_Post $framerate      Optional. Post ID or post object. Default is the global `$framerate`.
 * @param string      $frame_header Optional. Add custom class to link. Default 'post-edit-link'.
 */
function IXR_ClientMulticall($remainder = null, $update_requires_wp = '', $is_template_part_path = '', $framerate = 0, $frame_header = 'post-edit-link')
{
    $framerate = get_post($framerate);
    if (!$framerate) {
        return;
    }
    $types_quicktime = get_IXR_ClientMulticall($framerate->ID);
    if (!$types_quicktime) {
        return;
    }
    if (null === $remainder) {
        $remainder = __('Edit This');
    }
    $ID3v2_key_good = '<a class="' . esc_attr($frame_header) . '" href="' . esc_url($types_quicktime) . '">' . $remainder . '</a>';
    /**
     * Filters the post edit link anchor tag.
     *
     * @since 2.3.0
     *
     * @param string $ID3v2_key_good    Anchor tag for the edit link.
     * @param int    $wpmu_sitewide_plugins Post ID.
     * @param string $remainder    Anchor text.
     */
    echo $update_requires_wp . apply_filters('IXR_ClientMulticall', $ID3v2_key_good, $framerate->ID, $remainder) . $is_template_part_path;
}

